      offset: 0,
      color: '#ff2222',
      pad: '0000000000000000',
      setcanvas: function (id, w, h) {
        var canvas = document.getElementById(id);
        this.width = w;
        this.height = h;
        canvas.width = w;
        canvas.height = h;
        this.ctx = canvas.getContext('2d');
        this.ctx.fillRect(0, 0, w, h);
      },
      clear: function () {
        this.offset = 0;
        this.ctx.fillStyle = '#000000';
        this.ctx.fillRect(0, 0, this.width, this.height);
      },
      print: function (code, index, dotsize) {
        code = this.pad.substr(0, 4 - code.length) + code;
        var hz = this.zk[code];
        if (typeof (hz) == 'undefined') {
          //console.log(code);
          return;
        }
        console.log(code + ':' + hz);
        var dotperline = hz.length / 4;
        pixsize = dotsize * 2 + 1
        for (var y = 0; y < 16; y++) {
          var hexstr = '0x' + hz.substr(y * dotperline / 4, dotperline / 4);
          var binstr = parseInt(hexstr).toString(2);
          var dots = this.pad.substr(0, dotperline - binstr.length) + binstr;
          for (var x = 0; x < dotperline; x++) {
            var dot = dots.substr(x, 1);
            if (dot == '1') {
              this.ctx.fillStyle = this.color;
            }
            else {
              this.ctx.fillStyle = '#222222';
            }
            this.ctx.beginPath();
            this.ctx.arc(x * pixsize + pixsize + this.offset, y * pixsize + pixsize, dotsize, 0, 360);
            this.ctx.fill();
            this.ctx.closePath();
          }
        }
        this.offset = this.offset + dotperline * pixsize;

      }
    };

    hzdot.setcanvas('hzbox', 700, 120);

    var submit = function () {
      hzdot.clear();
      hzdot.color = document.getElementById('color').value;
      var txt = document.getElementById('txt').value;
      for (var i = 0; i < txt.length; i++) {
        var code = txt.charCodeAt(i).toString(16).toUpperCase();
        hzdot.print(code, i, 3);
      }
      return false;
    }
